import React, { Component } from 'react'
import logo from "../Constant/logo.svg";
import {Link,NavLink} from "react-router-dom";
// import "./NavBar.css";/
import { withStyles } from '@material-ui/core/styles';

// Define Styles here ↓
const styles={

};

function NavBar(props){

    return (
      <nav className="navbar">

        <ul className="navbar-container">

          {/* Logo */}
          <Link to="/" className="navbar-logoContainer">
            <img src={logo} />
          </Link>

          {/* Main Tabs/Routes */}
          <ul className="navbar-tabContainer">
            <li><NavLink exact activeClassName="active-link" to="/"><span>UX Projects</span></NavLink></li>
            <li><NavLink exact activeClassName="active-link" to="/projectDetail/:projectId"><span>Open Design</span></NavLink></li>
            <li><NavLink exact activeClassName="active-link" to="/about"><span>About</span></NavLink></li>
          </ul>

          {/* Secondary Tabs/Routes */}
          <ul className="navbar-tabContainer">
            {/* <li><a><span>Coorporation</span></a></li> */}
            <li><Link><span>中文</span></Link></li>
          </ul>

        </ul>
      </nav>
    );
};

export default withStyles(styles)(NavBar);
